import Styles from './icon-styles.scss'

import React from 'react'

export enum IconName {
  busLogin = 'data:image/png;base64,',
  busPeople = 'data:image/png;base64,',
  busLoginWith = 'data:image/png;base64,',
  peopleAwaitingBus = 'data:image/png;base64,'
}

type Props = {
  iconName: IconName
  className?: string
}

const Icon: React.FC<Props> = ({ iconName, className }: Props) => {
  return (
    <div className={[Styles.iconWrap, className].join(' ')}>
      <img data-testid="icon" className={Styles.icon} src={iconName} />
    </div>
  )
}

export default Icon
